import React from 'react';
import bgHome from "../../images/bgHome.jpeg";
import "./home.css"

function home () {
    return(
        <div className="home">
            <img src={bgHome} alt=""/>
            <div className="content">
            <h1>FULL STACK DVELOPER</h1></div>
        </div>
    )
};
export default home
